import React from 'react';

const DropDown = () => {
    const options = this.props.options;
    const list = options.map((color) => {
        return (
            <div className={`button r-5 p-10 mr-20 ml-20 bold mb-1 bg-${color.value}`}>
                {color.label}
            </div>
        )
    })
    return (
        <div>
            { list }
        </div>
    )
}
export default DropDown;
